    return(
        <div className="group border-l-red-600 border-l-[2px] mb-2">
            <a href="">
            <h3 className=" pl-2 text-2xl font-semibold font-sans font-text text-red-500 group-hover:text-black">{title}</h3> 
            </a>  
        </div>
    )
}
